import React from 'react';
import { Link } from 'react-router-dom';

const Home = ({ shows }) => {
  return (
    <div>
      <h1 className='p-4 text-center '>TV Shows</h1>
      <div className='mx-auto max-w-[300px] flex items-center flex-wrap justify-center gap-3'>
        {
            shows.map((show) => {
                return (
                    <div key={show.show.id} className='p-2 mb-4 bg-red-600 rounded-md'>
                        <Link to={`/details/${show.show.id}`}>
                        <img src={show?.show?.image?.medium} alt="imageOfShow" />
                        <p>{show?.show?.name}</p>
                        </Link>
                    </div>
                )
            })
        }
      </div>
    </div>
  );
};

export default Home;
